import React from 'react';

export default function Navbar() {
  return (
    <nav className="navbar header py-3 fixed-top">
    <div className="container d-flex align-items-center justify-content-between">
      {/* CTA Button */}
      <a href="/consult" className="btn btn-outline-light">
        Free Consultation
      </a>

      {/* Nav Links */}
      <ul className="navbar-nav flex-row mx-4">
        {navItems.map(label => (
          <li className="nav-item mx-2" key={label}>
            <a
              href={`/${label.toLowerCase().replace(/\s+/g, '-').replace(/[^a-z0-9\-]/g, '')}`}
              className="nav-link px-2 text-white"
            >
              {label}
            </a>
          </li>
        ))}
      </ul>

      {/* Logo */}
      <a className="navbar-brand ms-4" href="/">
        <img src="/images/logo-white.svg" alt="SarrdehTech" height="40" />
      </a>
    </div>
  </nav>
  );
}
